import UserServices from "../services/UserServices";
import welcome from "../img/welcome.jpg"
import 'bootstrap/dist/css/bootstrap.min.css';

export default function Welcome(){


    return(

        <>

        {UserServices.isLoggedin
                            ? UserServices.getLoggedinfo().role === "admin" && (

                                <div className="container">

                            <h1>Hi</h1>
                            <img src={welcome} width="100%" height = "auto"/>
                            </div>
                        )
                            : <h1>Please login first</h1>}


{UserServices.isLoggedin ? UserServices.getLoggedinfo().role && (

                               <div className="container">
                               <h1>We Say Welcome to {UserServices.getLoggedinfo().name} </h1>
                                <img src={welcome} width="100%" height = "auto"/>
                                </div>
                            ) : <h1>Please login first</h1>
                            }
        </>
    );

    }
